import React from "react";
import avatar from '../avatar.jpg'

const Profile = () => {
    return (
        <section>
            <div className="profile_container">
                <div className="img_container">
                    <img src={avatar} alt="" />
                </div>
            </div>
        </section>
    )
};

export default Profile;
